import './index.scss';
import './styles/normalize.scss';
import './styles/header.scss';
import './styles/media.scss';
import './styles/utility.scss';
import './stiles/top.scss';
import Header from './components/Header';

function App() {
  return (
  <>
    <Header/>
   <main className='main'>
      <div className="top">
        <div className="top__title">Found Posts</div>
        <div className="top__filter">Filter<img src='/svg/filter.svg' alt=""/></div>
      </div>

   </main>
  </>


  );
};

export default App;
